import FormGroup from '@mui/material/FormGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import { useEffect, useState } from 'react';

import Navbar from "./Navbar";
import '../styles/Confirm.css'

const Confirm = () => {

    const [check, setCheck] = useState([]);
    const handleChange = () => {
        setCheck(!check);
    };

    const [show, setShow] = useState(false);



    return (
        <>
            <Navbar />
            <div className="confirm-content">
                <h1>Så här går du tillväga</h1>
                <ul>
                    <li>Lägg kläderna i samma kartong som det kom i</li>
                    <li>Ta med kartongen till Nacka Kommun.</li>
                    <li>Vid inlämning av ditt paket sker utlämning av nytt paket</li>
                    <li>Du får en notis i appen när du har lämnat och hämtat uopp ditt nya paket.</li>
                </ul>
                <FormGroup>
                    <FormControlLabel control={<Checkbox onChange={handleChange} onClick={(setShow(!show))} />} label="Jag har läst och förstått instruktionerna" />
                </FormGroup>
                <div>
                    {
                      show && <button >OKEJ</button>
                    }
                </div>
            </div>
        </>
    );
}

export default Confirm;
